import React from "react";
import { Link } from "react-router-dom";
import "./MyCourses.css"; // Ensure this file is included

const MyCourses = () => {
  // Dummy data (replace with actual data if needed)
  const courses = [
    {
      id: 1,
      title: "Introduction to Cybersecurity",
      image: "/images/cybersecurity.jpg",
      earnings: 101,
      students: 2,
      publishedDate: "1/23/2025",
    },
  ];

  return (
    <div className="my-courses-container">
      <h2 className="page-title">My Courses</h2>
      <div className="table-container">
        <table className="courses-table">
          <thead>
            <tr>
              <th>All Courses</th>
              <th>Earnings</th>
              <th>Students</th>
              <th>Published On</th>
            </tr>
          </thead>
          <tbody>
            {courses.map((course) => (
              <tr key={course.id}>
                <td className="course-info">
                  <img src={course.image} alt={course.title} className="course-image" />
                  <Link to={`/course/${course.id}`} className="course-title">
                    {course.title}
                  </Link>
                </td>
                <td>${course.earnings}</td>
                <td>{course.students}</td>
                <td>{course.publishedDate}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default MyCourses;
